column8:
メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
パワーズドクター 背筋ベルトハードタイプ<br>
<br>
POWERS Dr.シリーズからハードな背筋ベルトが登場！<br>
背中のWクロスベルトが背中をグッと姿勢をホールド！<br>
通気性と伸縮性を持ち合わせた生地が背中からお腹周りを包みます。<br>
背中には6本のパワーズボーンでサポート、<br>
背筋ベルトを着用したまま締め付けを調整ができます。<br>
お腹周りもサポートしているので木になるぽっこりお腹にもオススメ。<br>
ついつい猫背になりがちなデスクワークだけでなく、<br>
スポーツや家事など普段使いもできます。<br>
<br>
【特徴】<br>
・マジックテープ式で着脱簡単！<br>
・伸縮性・通気性抜群の生地が360度しっかりサポート！<br>
・6本のパワーズボーンで着用したまま強さを調整！<br>
・お腹周りもサポート！<br>
・猫背になりがちなデスクワークや普段使いにオススメ！<br>
<br>
カラー：ブラック<br>
素材：ポリエステル,ポリウレタン<br>
<br>
サイズ：<br>
S ウエスト:63～75cm/身長:150～172cm/ジュニア・レディース向け<br>
M ウエスト:70～80cm/身長:165～175cm/レディース・メンズ向け<br>
L ウエスト:75～85cm/身長:175～185cm/メンズ向け<br>
XL ウエスト:85～95cm/身長:175～185cm/メンズ向け<br>
※補正用サイズとなっており少し小さいと感じる場合がございます。<br>
※身長・体重に合わせてお買い求めください。<br><style type="text/css">
